const Register = () => {
    const registerForm = () => <form>form</form>
    return ( 
    <Layout>
        <div className="col-md-3 offset-md-6">
            <h1>Register</h1>
            <br />
            {registerForm()}
        </div>
    </Layout>
    );
};

export default Register;
